import react from "react";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const linkStyle = {
  // color: "white",
  margin: "10px",
  fontSize: "20px",
  display: "inline-block",
  marginRight: "1em",
  textDecoration: "none",
};

const Navbar = ({ userdata, setToken, setUserdata }) => {
  return (
    <>
      <div className="heading">
        <div className="navName">
          <h1>Fitness Tracker</h1>
        </div>
        <body className="navBody">
          <div className="nav">
            <Link to="/" style={linkStyle}>
              HOME
            </Link>

            <Link to="/routines" style={linkStyle}>
              ROUTINES
            </Link>
            <Link to="/myroutines" style={linkStyle}>
              MY ROUTINES
            </Link>
            <Link to="/activities" style={linkStyle}>
              ACTIVITIES
            </Link>
            {!userdata && (
              <Link to="/register" style={linkStyle}>
                REGISTER
              </Link>
            )}
            {!userdata && (
              <Link to="/login" style={linkStyle}>
                LOGIN
              </Link>
            )}
            {userdata && (
              <Link className="addpost" to="/add" style={linkStyle}>
                ADD ROUTINES
              </Link>
            )}
            {userdata && (
              <Link
                to="/"
                style={linkStyle}
                onClick={() => {
                  setToken("");
                  setUserdata(null);
                  localStorage.removeItem("token");
                }}
              >
                LOG OUT
              </Link>
            )}
          </div>
        </body>
        {/* <div className="horizontal-nav3">
          {userdata ? <span>Hello {userdata.username} </span> : null}
        </div> */}
      </div>
    </>
  );
};

export default Navbar;
